import React from "react";
import Link from "next/link";
import styled from "styled-components";

const Title = styled.h1`
  color: red;
`;

const Home = () => {
  return (
    <div>
      <Title>Home</Title>
      <Link>
        <a>Page</a>
      </Link>
    </div>
  );
};

export default Home;
